// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";

import "./LicenseTools.sol";

enum ServiceType {
    READ,
    WRITE
}

struct ServiceInfo {
    uint256 serviceId;
    uint256 oneMonthLicencePrice;
    // uint256 reading10000PartsFeed; //percert using 10000 as base. Ex 138 means 1.38%
    // uint256 readingPeriodSeconds;
    // uint256 minimalWeiFeed;
    ServiceType serviceType;
    bytes32 name;
    string description;
}

uint256 constant MAX_NUMBER_OF_SERVICES = 255;
uint256 constant SERVICE_PERCENT_BASE = 10000;

contract ServiceManager is Ownable, AccessControlEnumerable {
    /**
    CONSTANTS
    */
    bytes32 public constant SERVICE_MANAGER_ROLE =
        keccak256("SERVICE_MANAGER_ROLE");

    using EnumerableSet for EnumerableSet.UintSet;

    /******************************
        EVENTS
    ******************************/

    event serviceAdded(uint256 id);
    event serviceUpdated(uint256 id);
    event serviceRemoved(uint256 id);

    //Modifiers
    modifier onlyRegisteredServices(uint256 serviceId) {
        require(registeredIds.contains(serviceId), "NOTFNDS");
        _;
    }

    modifier onlyServiceManager() {
        require(
            hasRole(SERVICE_MANAGER_ROLE, _msgSender()),
            "Unauthorize. Must has service Manager role"
        );
        _;
    }

    // Services
    mapping(uint256 => ServiceInfo) registeredServices;
    // List of Id for quick
    EnumerableSet.UintSet registeredIds;

    constructor() {
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(SERVICE_MANAGER_ROLE, _msgSender());
    }

    /**
     * @notice register service
     * @param serviceId service Id
     * @param serviceType service Type
     * @param name service short name
     * @param description service description
     */
    function registerService(
        uint256 serviceId,
        uint256 oneMonthLicencePrice,
        ServiceType serviceType,
        bytes32 name,
        string memory description
    )
        public
        onlyServiceManager
    {
        require(serviceId <= MAX_NUMBER_OF_SERVICES, "OUTRG");
        require(
            !registeredIds.contains(serviceId),
            "FND"
        );
        registeredIds.add(serviceId);
        ServiceInfo storage serviceInfo = registeredServices[serviceId];
        serviceInfo.serviceId = serviceId;
        serviceInfo.oneMonthLicencePrice = oneMonthLicencePrice;
        serviceInfo.serviceType = serviceType;
        serviceInfo.name = name;
        serviceInfo.description = description;
        emit serviceAdded(serviceId);
    }

    /**
     * @notice Update service
     * @param serviceId service Id
     */
    function updateService(
        uint256 serviceId,
        uint256 oneMonthLicencePrice
    )
        public
        onlyServiceManager
        onlyRegisteredServices(serviceId)
    {
        registeredServices[serviceId].serviceId = serviceId;
        registeredServices[serviceId]
            .oneMonthLicencePrice = oneMonthLicencePrice;
        emit serviceUpdated(serviceId);
    }

    /**
     * @notice remove service
     * @param serviceId service Id
     */
    function removeService(uint256 serviceId)
        public
        onlyServiceManager
        onlyRegisteredServices(serviceId)
    {
        registeredIds.remove(serviceId);
        delete registeredServices[serviceId];
        emit serviceRemoved(serviceId);
    }

    /**
    * @notice get all services Ids.
    * Return the entire set in an array
    //
    // WARNING	This operation will copy the entire storage to memory,
    // which can be quite expensive. This is designed to mostly be used by view
    // accessors that are queried without any gas fees.
    // Developers should keep in mind that this function
    // has an unbounded cost, and using it as part of a state-changing
    // function may render the function uncallable if the set grows to a
    // point where copying to memory consumes too much gas to fit in a block.
    */
    function getAllServiceIds() public view returns (uint256[] memory) {
        return registeredIds.values();
    }

    /**
     * @notice get service by id.
     * Return the entire set in an array
     * @param id service id
     */
    function getService(uint256 id)
        public
        view
        onlyRegisteredServices(id)
        returns (ServiceInfo memory)
    {
        return registeredServices[id];
    }

    /**
     * @notice get Extra Services Price Per Month
     * Return the sum of all services
     * @param servicesIdsPool current servicesIdsPool
     * @param serviceIds service id
     * @return sum service list price per month
     */
    function getAddedServicesPricePerMonth(
        uint256 servicesIdsPool,
        uint256[] memory serviceIds
    ) public view returns (uint256 sum) {
        require(
            (serviceIds.length <= MAX_NUMBER_OF_SERVICES),
            "OUTRG"
        );
        for (uint256 index = 0; index < serviceIds.length; index++) {
            uint256 serviceId = serviceIds[index];
            require(registeredIds.contains(serviceId), "NOTFNDS");
            if (!LicenseTools.getBoolean(servicesIdsPool, serviceId))
                sum += registeredServices[serviceId].oneMonthLicencePrice;
        }
    }

    /**
     * @notice get the total Price Per Month for all services in the servicesIdsPool
     * Return the sum of all services
     * @param servicesIdsPool current servicesIdsPool of services
     * @return sum service list price per month
     */
    function getServicesIdsPoolPricePerMonth(
        uint256 servicesIdsPool
    ) public view returns (uint256 sum) {

        for (uint256 index = 0; index < registeredIds.length() ; index++) {
            uint serviceId = registeredIds.at(index);
            if (LicenseTools.getBoolean(servicesIdsPool, serviceId))
                sum += registeredServices[serviceId].oneMonthLicencePrice;
        }
    }    
}

